fn go<K: AsRef<[u8]>, V>(
            f: &mut fmt::Formatter<'_>,
            node: &NodeRef<K, V>,
            offset: usize,
        ) -> fmt::Result {
            match node {
                None => writeln!(f, "{:width$}[B] <null>", "", width = offset),
                Some(ref h) => {
                    writeln!(
                        f,
                        "{:width$}[{}] {:?}",
                        "",
                        if is_red(node) { "R" } else { "B" },
                        h.key.as_ref(),
                        width = offset
                    )?;
                    go(f, &h.left, offset + 2)?;
                    go(f, &h.right, offset + 2)
                }
            }
        }
